#ifndef SYMXX_HUGE_TEST_CPP
#define SYMXX_HUGE_TEST_CPP
#if defined(SYMXX_ENABLE_HUGE)
#include "unittest.hpp"

namespace symxx::test
{
  template<typename T>
  void digitconv_tester()
  {
    auto num = random_digit<T>(std::numeric_limits<T>::lowest(),
                               std::numeric_limits<T>::max());
    Huge h(num);
    SYMXX_EXPECT_EQ(h.to<T>(), num);
    SYMXX_EXPECT_EQ(h.to_string(), std::to_string(num));
  }
  
  SYMXX_TEST(huge)
  {
    Huge s1{
        ""};
    Huge s2{
        ""};
    SYMXX_EXPECT_EQ((s1 + s2).to_string(),
                    "");
    SYMXX_EXPECT_EQ((s1 + s2 * Huge{"-1"}).to_string(),
                    "-");
    SYMXX_EXPECT_EQ((s1 - s2).to_string(),
                    "-");
    SYMXX_EXPECT_EQ((s2 - s1).to_string(),
                    "");
    SYMXX_EXPECT_EQ((s1 - s1).to_string(),
                    "0");
    
    SYMXX_EXPECT_EQ((s1 * s1).to_string(),
                    "");
    SYMXX_EXPECT_EQ((s2 * s2).to_string(),
                    "");
    SYMXX_EXPECT_EQ((s1 * s2).to_string(),
                    "");
    SYMXX_EXPECT_EQ((s1 * Huge{"0"}).to_string(),
                    "0");
    SYMXX_EXPECT_EQ((Huge{"0"} * s2).to_string(),
                    "0");
    Huge a, b, c, d, e, f, g, h;
    std::tie(a, b) = divrem(s1, s2);
    SYMXX_EXPECT_EQ(a.to_string(),
                    "0");
    SYMXX_EXPECT_EQ(b.to_string(),
                    "");
    std::tie(c, d) = divrem(s2, s1);
    SYMXX_EXPECT_EQ(c.to_string(),
                    "");
    SYMXX_EXPECT_EQ(d.to_string(),
                    "");
    std::tie(e, f) = divrem(s2, Huge{"8"});
    SYMXX_EXPECT_EQ(e.to_string(),
                    "");
    SYMXX_EXPECT_EQ(f.to_string(),
                    "6");
    std::tie(g, h) = divrem(s1, s1);
    SYMXX_EXPECT_EQ(g.to_string(),
                    "1");
    SYMXX_EXPECT_EQ(h.to_string(),
                    "0");
    
    SYMXX_EXPECT_EQ((s1 % s2).to_string(),
                    "");
    SYMXX_EXPECT_EQ((s2 % s1).to_string(),
                    "");
    //SYMXX_EXPECT_EQ("Pow 1",s1.pow(3), s1*s1*s1);
    //SYMXX_EXPECT_EQ("Pow 2",s2.pow(3), s2*s2*s2);
    //SYMXX_EXPECT_EQ("Pow 3",s1.pow(256).to_string(), "");
    SYMXX_EXPECT_EQ(
        ((s1 * s1) / s2).to_string(),
        "0");
    SYMXX_EXPECT_EQ(((s2 * s2 * s1) - (s1 / s2 * s2)).to_string(),
                    "");
    SYMXX_EXPECT_EQ(
        (s1 * s1 * s1 + s2 * s2 * s2 - s1 * s2 * s2 + (s1 * s1) / s2).to_string(),
        "");
    SYMXX_EXPECT_EQ(
        (s1 * s2 * (s2 * s2 * s1 + s2 * s2 * s1 - s1 / s2 * s2 + (s1 * s2) % s2)).to_string(),
        "");
    SYMXX_EXPECT_EQ((s1 * s2 * s1 * s2 * s2 * s2 * s2 *
                     (s2 * s2 * s1 + s2 * s2 * s2 - s2 / s1 * s2 +
                      (s1 * s2) * s2)).to_string(),
                    "");
    SYMXX_EXPECT_FALSE(s1 == s2);
    SYMXX_EXPECT_TRUE(s1 != s2);
    SYMXX_EXPECT_FALSE(s1 > s2);
    SYMXX_EXPECT_FALSE(s1 >= s2);
    SYMXX_EXPECT_TRUE(s1 < s2);
    SYMXX_EXPECT_TRUE(s1 <= s2);
    SYMXX_EXPECT_TRUE(s1 == s1);
    SYMXX_EXPECT_TRUE(s2 == s2);
    SYMXX_EXPECT_FALSE(Huge{"1"} == Huge{"2"});
    SYMXX_EXPECT_FALSE(Huge{"1234567891011"} != Huge{"1234567891011"});
    SYMXX_EXPECT_TRUE(Huge{"1"} < Huge{"2"});
    SYMXX_EXPECT_TRUE(Huge{"1"} <= Huge{"2"});
    SYMXX_EXPECT_FALSE(Huge{"1"} > Huge{"2"});
    SYMXX_EXPECT_FALSE(Huge{"1"} >= Huge{"2"});
    SYMXX_EXPECT_FALSE(Huge{"-3"} >= Huge{"2"});
    SYMXX_EXPECT_TRUE(Huge{"-2"} >= Huge{"-2"});
    SYMXX_EXPECT_TRUE(Huge{"-2"} == Huge{"-2"});
    SYMXX_EXPECT_FALSE(Huge{"0"} > Huge{"-0"});
    SYMXX_EXPECT_FALSE(Huge{"0"} != Huge{"-0"});
    SYMXX_EXPECT_TRUE(Huge{"0"} == Huge{"-0"});
    SYMXX_EXPECT_EQ(s1.gcd(s2), 9);
    SYMXX_EXPECT_EQ(Huge{3}.gcd(6), 3);
    
    //from string and to string
    for (int i = 0; i < 10; ++i)
    {
      auto str = rand_digit_str(10000);
      SYMXX_EXPECT_EQ(Huge{str}.to_string(), str);
    }
    //from int to int
    for (int i = 0; i < 100; ++i)
    {
      digitconv_tester<int>();
      digitconv_tester<unsigned int>();
      digitconv_tester<long>();
      digitconv_tester<unsigned long>();
      digitconv_tester<long long>();
      digitconv_tester<unsigned long long>();
    }
  }
}
#endif
#endif
